### Apply Feature Selection
# first, I specify the Lasso Regression model, and I
# select a suitable alpha (equivalent of penalty).
# The bigger the alpha the less features that will be selected.

# Then I use the selectFromModel object from sklearn, which
# will select the features which coefficients are non-zero

#selectfrommodel helps to reduce the features by using lasso aLIGORITHM

#so we need to have a very small alpha value .i can chjeck with cross validation the alpha values
#SelectFromModel is a meta transfer for selecting features based on importance weights 
#Lasso pinealise high weight
#estimator is Lasso 

feature_sel_model = SelectFromModel(Lasso(alpha=0.005, random_state=0)) # remember to set the seed, the random state in this function
feature_sel_model.fit(X_train, y_train)

feature_sel_model.get_support()
#True means the feature is important
#False means it can be skipped

feature_sel_model.get_support()

# let's print the number of total and selected features

# this is how we can make a list of the selected features
selected_feat = X_train.columns[(feature_sel_model.get_support())]

# let's print some stats
print('total features: {}'.format((X_train.shape[1])))
print('selected features: {}'.format(len(selected_feat)))
#features with coefficient shrank to zero is 82-21=61 whose coeffiecient  is near to zero by using Lasso algorithm

selected_feat

X_train=X_train[selected_feat]

X_train.head()